                 end in\n\n\
                 let calculateStrength: (Password, [PasswordCriteria]) -> \
                 PasswordStrength =\n\
                 fun password, criteria ->\n\
                 strength_of(List.length(metCriteria(password, criteria))) in\n\n\
                 # Update Password Strength Checker app model based on an \
