                 let (_, criteria, _) = model in\n\
                 let newStrength = calculateStrength(newPassword, criteria) in\n\
                 (newPassword, criteria, newStrength)\n\
                 | AddCriterion(newCriterion) =>\n\
                 let (password, criteria, _) = model in\n\
                 let newCriteria = newCriterion :: criteria in\n\
