                 let model = update(model, CancelBooking(\"Alice\", 0)) in\n\
                 getUserBookings(model, \"Alice\") == []   \n\
                 end;\n\n\
                 test\n\
                 let model = update(Model.init, AddBooking(\"Alice\", F, AM)) in\n\
                 let model = update(model, AddBooking(\"Bob\", F, AM)) in\n\
