                 let model = update(Model.init, AddBooking(\"Alice\", M, AM)) in\n\
                 let model = update(model, AddBooking(\"Bob\", M, PM)) in\n\
                 let model = update(model, AddBooking(\"Alice\", T, AM)) in\n\
                 let model = update(model, AddBooking(\"Bob\", T, PM)) in\n\
                 let model = update(model, AddBooking(\"Alice\", W, AM)) in\n\
                 let model = update(model, CancelBooking(\"Alice\", 0)) in\n\
                 let model = update(model, CancelBooking(\"Bob\", 3)) in\n\
                 getBookings(model) == [((W, AM), \"Alice\", 4), ((T, AM), \
                 \"Alice\", 2), ((M, PM), \"Bob\", 1)]   \n\
                 end;\n\n\
