                 let model = update(Model.init, AddBooking(\"Alice\", M, AM)) in\n\
                 let model = update(model, AddBooking(\"Bob\", M, AM)) in\n\
                 let model = update(model, AddBooking(\"Charlie\", M, AM)) in\n\
                 let model = update(model, AddBooking(\"Dave\", M, PM)) in\n\
                 let model = update(model, AddBooking(\"Eve\", M, PM)) in\n\
                 let model = update(model, CancelBooking(\"Bob\", 1)) in\n\
                 let model = update(model, CancelBooking(\"Dave\", 3)) in\n\
                 let model = update(model, CancelBooking(\"Alice\", 0)) in\n\
                 getBookings(model) == [((M, PM), \"Eve\", 4), ((M, AM), \
